// import dummy data
/*
import { DUMMYLISTINGS } from "../../data/dummyData";

// set intitial state of listings

const intialState = {
  listings: DUMMYLISTINGS,
};

const listingReducer = (state = intialState, action) => {
  switch (action.type) {
    case "ADD_TO_LISTINGS":
      // create new listing object
      // add to initial state
      return state;
    default:
      return state;
  }
};

export default listingReducer;
